import React from 'react';
import { FaGithub } from 'react-icons/fa';
export default function Project() {
    function handleClick(){
        window.open('https://github.com/slgedik', '_blank');
    }
    return (
        <div id="projects" className="projects items-center text-center py-8" style={{
            backgroundImage: 'url(https://static.vecteezy.com/system/resources/thumbnails/040/517/714/small/white-fabric-loop-animated-background-free-video.jpg)',
            backgroundSize: 'cover', 
            backgroundPosition: 'center', 
            backgroundRepeat: 'no-repeat',  
          }}>
            <h2 className="pt-6 pb-4 underline decoration-wavy italic font-semibold decoration-rose-800">
                To Access My Projects
            </h2>
            <div className="flex flex-col sm:flex-row justify-center items-center">
            <button
      onClick={() => window.open('https://github.com/slgedik', '_blank')}
      className="flex items-center bg-[#333] hover:bg-black text-white rounded-lg p-3 m-2 text-sm sm:text-lg"
    >
                <FaGithub style={{ marginRight: '8px' }} size={20} />
                Click Here
                </button>
            </div>
        </div>
    );
}
